;;; # FARSEC Experiments with Wicket
;;; 
;;; - Create a new directory to collect generated data sets and results. For example in this document "yourdirname" = "gor";
;;; - Display security related keywords for Wicket;
;;; - Generate data files for Wicket;
;;; - Display table of security related keywords mapped to their tf-idf scores;
;;; - Display prediction results for each treatment.
;; **

;; @@
(ns farsec.experiments
  (:use (seer naive-bayes random-forest logistic-regression ib-k multilayer-perceptron cpdp filtering))
  (:use (farsec core context data evaluate examples farsec-filter tfidf utils))
  (:use (incanter core stats io charts datasets)))
