;; **
;;; # Generate data files for Wicket
;; **

;; @@
; All output for the following code with appear in your "yourdirname" directory. In these experiments "yourdirname" = "gor".

(make-tbls "gor" "wicket" 100)                         ; make train and test data for WPP experiments.
(make-cross-tbls "gor" "ambari" "wicket" 100)          ; make train and test data for TPP experiments using "ambari" = source.
(make-farsec-tbls "gor" "ambari" "wicket" true)        ; make train and test data for WPPx experiments.
(make-farsec-tbls "gor" "ambari" "wicket" false)       ; make train and test data for TPPx experiments.
(make-pop-tbls "gor" "wicket" 100)                     ; make table of keywords and tf-idf values.
(make-predictions "gor" "ambari" "wicket" "wpp")       ; make table of prediction results
(make-predictions "gor" "ambari" "wicket" "tpp")
(make-predictions "gor" "ambari" "wicket" "wppx")
(make-predictions "gor" "ambari" "wicket" "tppx")
   
