;; **
;;; # Display table of security related keywords mapped to their tf-idf scores
;; **

;; @@
(def wicket-terms-tfidf
  (experiment-1
    (str "/resources/data1/wicket/wicket-sbr-old")
  	(str "/resources/data1/wicket/wicket-nsbr-old")
  	(str my-home "/gor/wicket-farsec-train.csv")
  	10))

(defn one-row [order tfidf-data]
  [(inc order)
   (first (nth tfidf-data order))
   (int   (first  (rest (nth tfidf-data order))))
   (int   (second (rest (nth tfidf-data order))))
   (int   (last   (rest (nth tfidf-data order))))])

(table-view 
  (map #(one-row %1 wicket-terms-tfidf) (range 10)) 
  :columns [(html-view "No.") 
            (html-view "Top 10 Terms for Wicket") 
            (html-view "NSBR-tfidf") 
            (html-view "SBR-tfidf") 
            (html-view "FARSEC-tfidf")])
