;; **
;;; # Display prediction results for each treatment
;; **

;; @@
(def wicket-predict-wpp (read-as-csv (str my-home "/gor/wpp-output.csv")))
(def wicket-predict-tpp (read-as-csv (str my-home "/gor/tpp-output.csv")))
(def wicket-predict-wppx (read-as-csv (str my-home "/gor/wppx-output.csv")))
(def wicket-predict-tppx (read-as-csv (str my-home "/gor/tppx-output.csv")))

(defn two-row [order predict-data]
  [(inc order)
   (first  (nth predict-data order))
   (nth  (rest (nth predict-data order)) 0)
   (nth  (rest (nth predict-data order)) 1)
   (int (read-string (nth  (rest (nth predict-data order)) 2)))
   (int (read-string (nth  (rest (nth predict-data order)) 3)))
   (int (read-string (nth  (rest (nth predict-data order)) 4)))
   (int (read-string (nth  (rest (nth predict-data order)) 5)))
   (int (read-string (nth  (rest (nth predict-data order)) 6)))
   (int (read-string (nth  (rest (nth predict-data order)) 7)))
   (int (read-string (nth  (rest (nth predict-data order)) 8)))
   (int (read-string (nth  (rest (nth predict-data order)) 9)))
   (int (read-string (nth  (rest (nth predict-data order)) 10)))])

(defn my-table-view [results]
  (table-view 
  	(map #(two-row %1 (rest results)) (range 5)) 
  	:columns [(html-view "No.") 
    	      (html-view "Source") 
              (html-view "Target") 
              (html-view "Algorithm") 
              (html-view "tn")
              (html-view "tp")
              (html-view "fn")
              (html-view "fp")
              (html-view "err") 
              (html-view "pd")
              (html-view "pf")
              (html-view "prec")
              (html-view "g-measure")]))
